script: |
  super -f text -I q8176.spq | sort > q8176.out

inputs:
  - name: q8176.spq
    data: |
      SELECT - col2 * col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE + col0 NOT IN ( - - col2, - ( - col0 ) * col0, 25 + - col2, 97 * - col1 );
  - name: tab1

outputs:
  - name: q8176.out
    data: |
      -4896
      -5015
      -6188
